import React, { useEffect, useState } from 'react';
import axios from 'axios';

function JobList() {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8080/api/jobs', { withCredentials: true })
      .then(res => setJobs(res.data))
      .catch(console.error);
  }, []);

  return (
    <div>
      <h2>Available Jobs</h2>
      {jobs.map(job => (
        <div key={job.id}>
          <h4>{job.title}</h4>
          <p>{job.description}</p>
        </div>
      ))}
    </div>
  );
}

export default JobList;
